import React from "react";
import styled from "styled-components";
import BGTexture from "../images/ep_naturalblack.png";

export default function AboutMe() {
  return (
    <AboutMeWrapper style={{ backgroundImage: `url(${BGTexture})` }}>
      <h1>tom</h1>
    </AboutMeWrapper>
  );
}

const AboutMeWrapper = styled.div`
  margin: 0;
  position: aboslute;
  z-index: -70;
  top: 100vh;
  width: 100vw;
  height: 100vh;
  background: black;
  clip-path: polygon(0 0, 100% 22%, 100% 100%, 0 76%);
`;
